@prefix : <http://www.semanticweb.org/ontologies/patientRecord#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .

:PatientRecord a owl:Class ;
    rdfs:subClassOf :System ,
    [ a owl:Restriction ;
      owl:allValuesFrom :GDPRCompliantEncryption ;
      owl:onProperty :hasEncryption
    ] .

:GDPRCompliantEncryption a owl:Class .
:System a owl:Class .
:hasEncryption a owl:ObjectProperty .
